window.bookSummaryJSON = "<p>I have one goal - take down the man responsible for my parents' deaths. </p> <p>Until I lock eyes with a stranger across the courtroom.</p> <p>Tobias Kosta. Notorious billionaire. Rumored criminal. And the most beautiful man I’ve ever seen.</p> <p>Once I leave this courtroom, I hope to never see him again. But then he hires me to be his lawyer. And I’m forced deeper into his world.</p> <p>He’s enigmatic. Dangerous. Ignites a passion I can’t ignore.</p> <p>The closer I get to him, the more secrets unravel. </p> <p>Is he my past? My future? Or my downfall?</p>"; 
